  return (
    <div className="bg-gray-900 text-white font-sans">
      <Navbar />
      <Hero />
      <About />
      <Projects />
      <Contact />
      <footer className="text-center text-gray-400 p-4">
        © 2025 Marewane Fertikh — Tous droits réservés.
      </footer>
    </div>
  );
}


export default App;
